import { useEffect } from "react"
import { useDispatch } from "react-redux"
import { triggerGetUser } from "../../../store/user"
import MainTabel from "./mainTabel"

const Main = () => {
    const dispatch = useDispatch()

    useEffect(() => {
        dispatch(triggerGetUser())
    }, [])

    return (
        <>
            <MainTabel />
        </>
    )
}

export default Main
